import React from 'react';




class AppHeader extends React.Component {
  

 
  render() {
    return(
      <div>
        <img src="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/3c2de0d3-f642-445f-9852-f3505837f06c/dbx7cht-1b9e03b6-5395-48ea-bee2-e9f3c8a79c39.png/v1/fill/w_886,h_902,strp/chibi_goku_ultra_instinto_by_jaredsongohan_dbx7cht-pre.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..waIqZu6Dsk_O21tNz307ragHqkcx21sRrBLBPN42Tug"
         height="40px" width="40px"className="main-button Home-Page" onClick ={this.props.selectAction.bind(this, "homePage")} value="HomePage"/>
        <button className="main-button" onClick ={this.props.selectAction.bind(this, "findSound")}>find Sound</button>
        <button className="main-button" onClick={this.props.selectAction.bind(this, "findArtist")}>find Artist</button>
      </div>
    )
  }
}

export default AppHeader;
